def longest_consistent_substring(seq) -> int:
    max_length = 1
    substring_begin_idx = -1

    for i in range(1, len(seq)):
        if seq[i] > seq[i-1]:
            if substring_begin_idx < 0:
                substring_begin_idx = i-1

        elif substring_begin_idx >= 0:
            # If found increasing consistent substring is longer than the longest previous one
            curr_length = i-substring_begin_idx+1
            if curr_length > max_length:
                sum_indices = sum(range(substring_begin_idx, i+1))
                sum_values = sum(seq[substring_begin_idx:i+1])

                while curr_length > max_length:
                    # Check if the sum of a current slice of a substring is equal to the sum of appropriate indices
                    if sum_values == sum_indices and curr_length > max_length:
                        max_length = curr_length
                        print('Found:', seq[substring_begin_idx:i+1], substring_begin_idx, i)
                        break
                    elif sum_values > sum_indices:
                        i -= 1
                    else:
                        substring_begin_idx += 1
                    curr_length -= 1

            substring_begin_idx = -1

    return max_length if max_length > 1 else 0


